void Game::ComposeFrame()
{
	if ((isStarted) && (!isGameOver)) {

		rect.Draw(gfx);
		meter.Draw(gfx);
		lives.Draw(gfx);
		dude.Draw(gfx);

		for (int i = 0; i < npoos; i++) {
			if (!poos[i].TestCollision(dude)) { 
				poos[i].Draw(gfx);
			}
		}
	}
	else if (isGameOver){
		drawGameOver(xTitle, yTitle);
	}
	else {
		drawTitle(xTitle, yTitle);
	}
	//gfx.drawCircle(200, 200, 100, Colors::Cyan);
}

